<p>A 组件的 setup 函数中调用 onMounted 函数会将该钩子函数注册到 A 组件上；而在 B 组件的 setup 函数中调用 onMounted 函数会将钩子函数注册到 B 组件上；要想实现这一点，则需要维护一个变量 <code>currentInstance</code>，用它来存储当前组件实例:</p>
